  01> LUDBROOK, Miriam Robin
  b 22.01.1960
  Miriam b. at Christchurch. Address: 2 Huntingdon Street, London NI IBU, England.
  Miriam was educated at Epsom Normal Primary School, Epsom Girls' Grammar School,
  Selwyn College and Massey University. She went to London in 1980 where she trained
  as a studio engineer and later became a tutor in Sound and Music Technology at
  Hurricane and Firehouse Studios. She is a recent graduate of the National Film and
  Television School and is currently working as a sound editor in the film industry.
  Her interests include music composition, surfing and rock climbing. She has played in many bands
  including "The Primmers", "Spies of Saturn" and "Pretty Pretty".
  02> LUDBROOK, Rachael Elisabeth
  b 23.08.1965
  Address: 24 Wendling, Gospel Oak, London NW6, England.
  Rachael was educated at Model Country School, Selwyn College and London College of Printing. She
  is a graphic designer and is currently completing her final year of two year graphic design course.
  03> LUDBROOK, Jason Mark
  b 31.07.1969
  Address: 6 Richmond Road, Ponsonby, Auckland.
  Jason was educated at Epsom Normal Primary School, Metropolitan College and Auckland Institute of
  Technology. He is a drummer with various Auckland groups, and a computer programmer.
  ** ** ****
  03> LUDBROOK, Richard Lawrence m on 11.04.1970 to RIJKEN, Johanna
  b 06.09.1946
  Address: 161 Mellons Bay Road, Howick, Auckland.
  Richard was educated at Wanganui Collegiate School and is a sales consultant.
  01> LUDBROOK, Samuel Richard
  b 27.11.1972
  Samuel was educated at Macleans College, Howick and Waikato University and is now living in London.
  02> LUDBROOK, Ingrid Trudi
  b 14.01.1974
  Ingrid was educated at Macleans College, Howick and Waikato University and is now living in Perth.
  02>'LUDBROOK, Hereward Reginald
  b 10.08.1897 d 18.09.1918
  Hereward b. at "Tupe Tupe", Ohaeawai and d. of wounds in France in WW1. He was educated at
  Huntley School, Wanganui Collegiate School and Lincoln College, farmed at Pakaraka in the
  Bay of Islands.
  Hereward left New Zealand on 31 December 1917 on the HMNZT No 99, "Athenic" as a Sergeant in
  Specialist Company of the 33rd Reinforcements to the 1914 NZ Expeditionary Force (Reg No
  54667). He was promoted to Leiutenant Sergeant and was with the NZ Rifle Brigade. He took
  part in the Battles of Havrincourt-Epehy, Cambrai and the Hindenburg Line.
  03> LUDBROOK, Ronald Henry m on 26.01.1928 to GREENING, Dorothy
  b 18.05.1899 d ** **.1953
  b 18.08.1899 d ****.1968
  Ronald b. at Tupetupe and m. at Paihia. Dorothy, d/o John and Lucy Greening, b. at Bradford, Yorkshire
